import React from 'react'
import { AppBar, Avatar , List} from '@mui/material'

const BottomBar = ({ current }) => {
  return (
    <>
        <AppBar position="fixed" sx={{ bgcolor: "White", height: "20%", width: "30vw", top: 'auto', bottom: 0, left: 0, margin: "2vh" }}>
          <Avatar alt={`${current.username}`} src={`${current.avatar}`} />
        </AppBar>
    </>

  )
}

export default BottomBar
